import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Avatar from "@material-ui/core/Avatar";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import Alert from "@material-ui/lab/Alert";

const useStyles = makeStyles((theme) => ({
  root: {
    width: "100%",
    backgroundColor: "#0D1117",
    paddingLeft: 10,
    paddingRight: 10,
    color: "#fff",
  },
  nested: {
    paddingLeft: theme.spacing(4),
  },
  listItemContainer: {
    marginBottom: 5,
  },
  listItem: {
    border: "1px solid #104d7c",
    borderRadius: 5,
  },
  avatar: {
    background: "#fff",
    color: "#2c2c2c",
  },
  alerta: {
    display: "flex",
    maxHeight: 30,
    justifyContent: 'center',
    alignItems: 'center',
    color: 'theme.palette.success.main'
  },
}));

const PokemonsList = () => {
  const classes = useStyles();

  return (
    <List
      component="nav"
      aria-labelledby="nested-list-subheader"
      className={classes.root}
    >
      <div className={classes.listItemContainer}>
        <ListItem button className={classes.listItem}>
          <ListItemIcon>
            <Avatar className={classes.avatar}>H</Avatar>
          </ListItemIcon>
          <ListItemText primary="Pokemon 1" />
          <Alert className={classes.alerta} variant="outlined" severity="success">
            New!
          </Alert>
        </ListItem>
      </div>
      <div className={classes.listItemContainer}>
        <ListItem button color="primary" className={classes.listItem}>
          <ListItemIcon>
            <Avatar className={classes.avatar}>W</Avatar>
          </ListItemIcon>
          <ListItemText primary="Pokemon 2" />
        </ListItem>
      </div>
    </List>
  );
};

export default PokemonsList;
